import React from "react";
// Components
import "./News.css";
import image1 from '../../image/gift.png'
import {Container, Row, Col} from 'reactstrap'
import ReactPlayer from "react-player";
import {Card} from "react-bootstrap";


const News = () => (

    <div className="w-responsive text-center mx-auto p-3 mt-2">
        <Card >
            <img src={image1} alt=" gift_photo "/>
            <h1>Taking Your GDG Gift</h1>
            <h3>If you join GDG online talk you can get a gift</h3>
            <h6>Date: 28 Oct 2020
                Time: 0830-1530
                Venue: 3/F staff office,LWL
                Abstract: ...</h6>
            <h6>* If you get a luckydraw gift, please tell us your name of the gift. Here is GDG channel:
                <a href="https://www.youtube.com/watch?v=YLOxkSvIu2s&ab_channel=GDGCloudHK"></a>
                <ReactPlayer url="https://www.youtube.com/watch?v=YLOxkSvIu2s&ab_channel=GDGCloudHK"/>
            </h6>
        </Card>
    </div>
)
;

export default News;
